import React from "react";
import { useState } from "react";
import {
  Grid,
  Paper,
  Typography,
  Chip,
  Stack,
  IconButton,
} from "@mui/material";
import Card from "@mui/material/Card";
import ResponsiveDrawer from "../utility/ResponsiveDrawer";
import Avatar from "@mui/material/Avatar";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import CalendarMonthIcon from "@mui/icons-material/CalendarMonth";
import ScheduleIcon from "@mui/icons-material/Schedule";
import CurrencyRupeeIcon from "@mui/icons-material/CurrencyRupee";
import { styled } from '@mui/material/styles';

import gojo from "../images/gojo.png";

const ResearchPaper = () => {
  // checking local Storage after each update
  var [isDrawerOpen, setIsDrawerOpen] = useState(true);

  window.onstorage = () => {
    setIsDrawerOpen(JSON.parse(window.localStorage.getItem("drawerOpen")));
  };

  const theme = createTheme({
    palette: {
      primary: {
        main: "#4A2145",
      },
      secondary: {
        main: "#11cb5f",
      },
    },
  });

  const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

  const ResearchCard = () => {
    return (
      <React.Fragment>
        <ThemeProvider theme={theme}>
          <Grid
            container
            elevation={3}
            style={{
              border: "2px solid black",
              width: "50rem",
              padding: "1rem",
            }}
          >
            <Grid
              xs={12}
              sm={3}
              sx={{
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              <Avatar
                alt="Remy Sharp"
                src={gojo}
                sx={{ width: 56, height: 56 }}
              />
            </Grid>
            <Grid item md={3}>
              <Typography variant="h5" gutterBottom align="left">
                Research on xyz
              </Typography>
              <Typography variant="body2" gutterBottom align="left">
                Sridhar Iyer
              </Typography>
              <Stack
                direction="row"
                spacing={1}
                style={{ marginTop: "0.5rem" }}
              >
                <Chip label="ReactJS" color="primary" />
                <Chip label="NLP" color="primary" />
              </Stack>
            </Grid>
            <Grid item md={3}>
              <Stack direction="column" spacing={2}>
                <CalendarMonthIcon color="success" > <span sx={{color:'black'}}> 2 months </span></CalendarMonthIcon>
                <ScheduleIcon color="success" > <span style={{color:'black'}}> 20hrs/week </span></ScheduleIcon>
                <CurrencyRupeeIcon color="success" > <span style={{color:'black'}}> 5000 </span></CurrencyRupeeIcon>
              </Stack>
            </Grid>
            <Grid item md={3}></Grid>
          </Grid>
        </ThemeProvider>
      </React.Fragment>
    );
  };
  return (
    <>
      <div>
        <ResponsiveDrawer drawerHeading={"All Research Paper"} />
        <div
          className="researchContainer"
          style={{ marginLeft: isDrawerOpen ? "245px" : "10px" }}
        >
          <ResearchCard />
        </div>
      </div>
    </>
  );
};

export default ResearchPaper;
